    color: 'border-blue-400',
    features: [
      '„Éô„Éº„Ç∑„ÉÉ„ÇØ„Éó„É©„É≥„ÅÆÂÖ®Ê©üËÉΩ',
      '„Éï„Ç°„Çπ„Éà„Éë„Çπ‰∫àÁ¥Ñ',
