    color: 'border-yellow-400',
    features: [
      '„Ç∑„É´„Éê„Éº„Éó„É©„É≥„ÅÆÂÖ®Ê©üËÉΩ',
      'Â∞ÇÈñÄ„Çπ„Çø„ÉÉ„ÉïÊåáÂêçÁÑ°Êñô',
      'VIPÂÑ™ÂÖà‰∫àÁ¥Ñ',
      '„Éõ„ÉØ„Ç§„Éà„Éã„É≥„Ç∞Âπ¥2Âõû',
