      'Âè£ËÖî„Ç±„Ç¢Áî®ÂìÅ„Éó„É¨„Çº„É≥„Éà',
      'ÁâπÂà•ÁâπÂÖ∏: 24ÊôÇÈñìÁ∑äÊÄ•ÂØæÂøú, Ê≠ØÁßëË°õÁîüÂ£´„Ç¢„Çµ„Ç§„É≥, ÁâπÂà•Ë®∫ÁôÇÂÆ§Âà©Áî®ÂèØ'
    ],
    button: '‰ªä„Åô„ÅêÂä†ÂÖ•',
    highlight: false,
    badge: '„Éó„É¨„Éü„Ç¢„É†',
    disabled: false
  }
];

const Plans = () => {
  const [selected, setSelected] = useState('basic');
  const [isYearly, setIsYearly] = useState(false);
  const navigate = useNavigate();

  const getPrice = (price) => isYearly ? price * 12 * 0.9 : price;
  const getPriceLabel = () => isYearly ? 'Âπ¥È°çÔºà10%OFFÔºâ' : 'ÊúàÈ°ç';

  const handleJoin = (planId) => {
