              {plan.id === 'gold' && <span className="mr-2">üëë</span>}
              {plan.name}
            </h2>
            <div className="text-3xl font-extrabold mb-2 text-gray-900">
              ¬•{getPrice(plan.price).toLocaleString()}
              <span className="text-base font-medium text-gray-500">/{isYearly ? 'Âπ¥' : 'Êúà'}</span>
            </div>
            <ul className="text-left mb-6 space-y-2">
              {plan.features.map((f, i) => (
                <li key={i} className="flex items-center text-gray-700">
                  <span className="text-green-500 mr-2">‚úî</span>{f}
